import React from 'react';
import ReactPlayer from 'react-player'

const getStarted=(props)=>{
    return (
        <div className="video">
            <ReactPlayer url='https://www.youtube.com/watch?v=JGwWNGJdvx8'
             playing 
             controls="true"
             width="100%"
             height="60%"/>  
        </div>
    )
};

export default getStarted;
